import React, { useState, useEffect } from 'react'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

import Locations from './Pages/Locations';
import Login from './Pages/Login';
import SignUp from './Pages/SignUp';


function App() {

  const [data, setData] = useState([{}]);


  useEffect(() => {
    const getData = async () => {
      const response = await fetch("/members");
      const jsonData = await response.json();
      setData(jsonData.members);
    }

    getData();
  }, [])

  const members = data.map((item, i) =>
    <li key={i}>{item.toString()}</li>
  );
  return (
    <Router>
      <div >
        <span>My new app</span>
        <br></br>

        {members && members.length > 0 ? <ul>{members}</ul> : <span>loading...</span>}
        {console.log(members)}
      </div>
      <Routes>
        <Route exact path='/' element={<></>}></Route>
        <Route exact path='/locations' element={<></>}></Route>
        <Route exact path='/login' element={<></>}></Route>
        <Route exact path='/signup' element={<></>}></Route>
      </Routes>
    </Router>

  );
}

export default App;
